import React from 'react'
import './Footer.css'

const Footer = () => {
  return(
    <div className="footerContainer">
      <p className="contactFooter">Contact</p>
      <p className="instagramLogoFooter">Instagram</p>
      <p className="facebookLogoFooter">Facebook</p>
    </div>
  )
}

export default Footer
